import React, {useEffect} from "react";

const SecondSibling = (props) =>{
    let counterval = props.counter;

    useEffect(()=>{
        if(counterval % 5 ==0){
            if(counterval==5){
                counterval=5;
            }
            if(counterval>5){
            counterval+=5;
            }
        }
        },[props.counter])

    

    return (
        <div>
            <h1>{counterval}</h1>
        </div>
    )

}

export default SecondSibling;
